"use es6";

import React from "react";

const HomePage = () => {
  const link1 = `https://sedo.com/us/photos.html`;
  const link2 = `https://www.cnn.com/`;

  const source1 = `${pagehtml.find("img").first().attr("src")}`;
  const source2 = `${pagehtml.find("img").first().attr("src")}`;

  document.getElementById("img1").src = source1;
  document.getElementById("img2").src = source2;
  return (
    <>
      <div>
        <h1>HOME</h1>

        <img id="img1" src="" />
        <img id="img2" src="" />
      </div>
    </>
  );
};

export default HomePage;
